ch might possibly leave a casual observer who hadn't followed the trial, with a belief that her findings were possibly discredited in some way) - is just bad, though.  It was completely the opposite.  This had to do with only a brief time to wrap the last 3-4 weeks of trial up in 5 minutes.\n\nVERDICT: State of Arizona vs. Jodi Arias (for the Murder of Travis Alexander).\n\nCOUNT 1: First Degree Murder (Premeditated) GUILTY: 5 jurors\nCOUNT 1: Felony Murder (no votes)\nCOUNT 1: BOTH First Degree Premeditated AND Felony Murder GUILTY: 7 Jurors\n\nJUSTICE4TRAVIS (and family) AT LAST!\n\n\"If I ever hurt Travis - if I ever KILLED Travis - I would BEG FOR the Death Penalty\" ~ Jodi Arias 07-15-08\n\n\"If I did that, I'd be fully ready to face the consequences...I'm all for the ten commandments - thou shalt not kill.\" ~ Jodi Arias 07-15-08"}]},"subscribeButton":{"buttonRenderer":{"style":"STYLE_DESTRUCTIVE","size":"SIZE_DEFAULT","isDisabled":false,"text":{"runs":[{"text":"Subscribe"}]},"navigationEndpoint":{"clickTrackingParams":"CJMBEJsrIhMIy7ngpoya6gIVisG0Ch290Am1","commandMetadata":{"webCommandMetadata":{"ignoreNavigation":true}},"modalEndpoint":{"modal":{"modalWithTitleAndButtonRenderer":{"title":{"simpleText":"Want to subscribe to this channel?"},"content":{"simpleText":"Sign in to subscribe to this channel."},"button":{"buttonRenderer":{"style":"STYLE_BLUE_TEXT","size":"SIZE_DEFAULT","isDisabled":false,"text":{"simpleText":"Sign in"},"navigationEndpoint":{"clickTrackingParams":"CJQBEP2GBCITCMu54KaMmuoCFYrBtAodvdAJtTIJc3Vic2NyaWJl","commandMetadata":{"webCommandMetadata":{"url":"https://accounts.google.com/ServiceLogin?service=youtube\u0026uilel=3\u0026passive=true\u0026continue=https%3A%2F%2Fwww.youtube.com%2Fsignin%3Faction_handle_signin%3Dtrue%26app%3Ddesktop%26hl%3Den%26next%3D%252Fwatch%253Fv%253DA2XvzoNqUh8%26continue_action%3DQUFFLUhqbnJEVVpGNzMwS0JBc2djQy1QUjVacmNjUTNPd3xBQ3Jtc0tuU2VZTUh4dnR2czYzUENTRk5iR1dtTHVNVzB6aWF4eGhWSTRIX2xWZFlGLUVkZE0yMXhwQ3ZtWV96dT
